const commonDenominators=(...e)=>{const t=e.filter(e=>Number.isInteger(e)&&e>0);const n=[Math.min(...t)];let r=Math.ceil(n[0]/2);if(!t.length)return[];if(r<2)return[1];while(r>0){if(n[0]%r===0)n.push(r);r--}n.reverse();if(t.length===1)return[...n];t.splice(1,t.length-1).map(e=>{let t=n.length-1;while(t>=0){if(e%n[t]!==0){n.splice(t,1)}t--}});return n};module.exports=commonDenominators;